import Banner from 'Components/Banner/Banner'
import styles from './Home.module.css'
import posts from 'json/posts.json'

const Home = () => {
  return (
    <main>
      <Banner />

      <ul className={StyleSheet.posts}>
        {posts.map((post) => (
          <li key={post.id}>
            Post
          </li>
        ))}
      </ul>
    </main>
  )
}

export default Home
